        .eq(this.thispickey)
        .addClass("active");
      this.bigpic = this.pictures[this.thispickey].src;
    },
    thispic(item, index) {
      this.thispickey = index;
      $(".small-pic-wrap img").removeClass("active");
      $(".small-pic-wrap img")
        .eq(index)
        .addClass("active");
      this.bigpic = item.src;
    },
    backoutShenpi() {
      event.stopPropagation();
      this.showBackoutBox = true;
    },
    sureBackout() {
      this.showBackoutBox = false;
